import React, { useEffect, useState } from 'react';
import { Fetch } from '../../Tools';

const Home = () => {
    const [posts, setPosts] = useState(null);

    useEffect(async () => {
        const res = await Fetch(`
            {
                homePage {
                    id
                    title
                    author
                    category
                    likes
                    body
                }
            }
        `);
        setPosts(res.homePage);
    }, [])

    return (
        <div>
            {/* {
                posts ? 
                posts.map(post => 
