                        author={post.author} 
                        category={post.category}
                        likes={post.likes}
                        id={post.postId}
                        createdAt={post.createdAt}
                        token={this.props.token}
                    >
                        {post.body}
                    </Post>
                )
                : <Loading />
            } */}
            Hi
        </div>
    )
}

export default Home;
